selector_to_html = {"a[href=\"#documentation-api-reference\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><a class=\"tippyAnchor reference external\" href=\"https://playwright.dev\">Documentation</a> | <a class=\"tippyAnchor reference external\" href=\"https://playwright.dev/docs/api/class-playwright\">API reference</a><a class=\"headerlink\" href=\"#documentation-api-reference\" title=\"Link to this heading\">#</a></h2><p>Playwright is a framework for Web Testing and Automation. It allows testing <a class=\"tippyAnchor reference external\" href=\"https://www.chromium.org/Home\">Chromium</a>, <a class=\"tippyAnchor reference external\" href=\"https://www.mozilla.org/en-US/firefox/new/\">Firefox</a> and <a class=\"tippyAnchor reference external\" href=\"https://webkit.org/\">WebKit</a> with a single API. Playwright is built to enable cross-browser web automation that is <strong>ever-green</strong>, <strong>capable</strong>, <strong>reliable</strong> and <strong>fast</strong>.</p>", "a[href=\"#capabilities\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Capabilities<a class=\"headerlink\" href=\"#capabilities\" title=\"Link to this heading\">#</a></h2><h3>Resilient \u2022 No flaky tests<a class=\"headerlink\" href=\"#resilient-no-flaky-tests\" title=\"Link to this heading\">#</a></h3><p><strong>Auto-wait</strong>. Playwright waits for elements to be actionable prior to performing actions. It also has a rich set of introspection events. The combination of the two eliminates the need for artificial timeouts - a primary cause of flaky tests.</p><p><strong>Web-first assertions</strong>. Playwright assertions are created specifically for the dynamic web. Checks are automatically retried until the necessary conditions are met.</p>", "a[href=\"#no-trade-offs-no-limits\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">No trade-offs \u2022 No limits<a class=\"headerlink\" href=\"#no-trade-offs-no-limits\" title=\"Link to this heading\">#</a></h3><p>Browsers run web content belonging to different origins in different processes. Playwright is aligned with the architecture of the modern browsers and runs tests out-of-process. This makes Playwright free of the typical in-process test runner limitations.</p><p><strong>Multiple everything</strong>. Test scenarios that span multiple tabs, multiple origins and multiple users. Create scenarios with different contexts for different users and run them against your server, all in one test.</p>", "a[href=\"#resilient-no-flaky-tests\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Resilient \u2022 No flaky tests<a class=\"headerlink\" href=\"#resilient-no-flaky-tests\" title=\"Link to this heading\">#</a></h3><p><strong>Auto-wait</strong>. Playwright waits for elements to be actionable prior to performing actions. It also has a rich set of introspection events. The combination of the two eliminates the need for artificial timeouts - a primary cause of flaky tests.</p><p><strong>Web-first assertions</strong>. Playwright assertions are created specifically for the dynamic web. Checks are automatically retried until the necessary conditions are met.</p>", "a[href=\"#examples\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Examples<a class=\"headerlink\" href=\"#examples\" title=\"Link to this heading\">#</a></h2><p>To learn how to run these Playwright Test examples, check out our <a class=\"tippyAnchor reference external\" href=\"https://playwright.dev/docs/intro\">getting started docs</a>.</p>", "a[href=\"#page-screenshot\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Page screenshot<a class=\"headerlink\" href=\"#page-screenshot\" title=\"Link to this heading\">#</a></h3><p>This code snippet navigates to Playwright homepage and saves a screenshot.</p>", "a[href=\"#evaluate-in-browser-context\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Evaluate in browser context<a class=\"headerlink\" href=\"#evaluate-in-browser-context\" title=\"Link to this heading\">#</a></h3><p>This code snippet navigates to example.com, and executes a script in the page context.</p>", "a[href=\"#intercept-network-requests\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Intercept network requests<a class=\"headerlink\" href=\"#intercept-network-requests\" title=\"Link to this heading\">#</a></h3><p>This code snippet sets up request routing for a page to log all network requests.</p>", "a[href=\"#manually\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Manually<a class=\"headerlink\" href=\"#manually\" title=\"Link to this heading\">#</a></h3><p>Add dependency and install browsers.</p>", "a[href=\"#resources\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Resources<a class=\"headerlink\" href=\"#resources\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#using-init-command\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Using init command<a class=\"headerlink\" href=\"#using-init-command\" title=\"Link to this heading\">#</a></h3><p>The easiest way to get started with Playwright Test is to run the init command.</p>", "a[href=\"#installation\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Installation<a class=\"headerlink\" href=\"#installation\" title=\"Link to this heading\">#</a></h2><p>Playwright has its own test runner for end-to-end tests, we call it Playwright Test.</p>", "a[href=\"#mobile-and-geolocation\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Mobile and geolocation<a class=\"headerlink\" href=\"#mobile-and-geolocation\" title=\"Link to this heading\">#</a></h3><p>This snippet emulates Mobile Safari on a device at given geolocation, navigates to maps.google.com, performs the action and takes a screenshot.</p>", "a[href=\"#full-isolation-fast-execution\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Full isolation \u2022 Fast execution<a class=\"headerlink\" href=\"#full-isolation-fast-execution\" title=\"Link to this heading\">#</a></h3><p><strong>Browser contexts</strong>. Playwright creates a browser context for each test. Browser context is equivalent to a brand new browser profile. This delivers full test isolation with zero overhead. Creating a new browser context only takes a handful of milliseconds.</p><p><strong>Log in once</strong>. Save the authentication state of the context and reuse it in all the tests. This bypasses repetitive log-in operations in each test, yet delivers full isolation of independent tests.</p>", "a[href=\"#powerful-tooling\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Powerful Tooling<a class=\"headerlink\" href=\"#powerful-tooling\" title=\"Link to this heading\">#</a></h3><p><strong><a class=\"tippyAnchor reference external\" href=\"https://playwright.dev/docs/codegen\">Codegen</a></strong>. Generate tests by recording your actions. Save them into any language.</p><p><strong><a class=\"tippyAnchor reference external\" href=\"https://playwright.dev/docs/inspector\">Playwright inspector</a></strong>. Inspect page, generate selectors, step through the test execution, see click points and explore execution logs.</p>", "a[href=\"#playwright\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">\ud83c\udfad Playwright<a class=\"headerlink\" href=\"#playwright\" title=\"Link to this heading\">#</a></h1><p><a class=\"tippyAnchor reference external\" href=\"https://www.npmjs.com/package/playwright\"><img alt=\"npm version\" loading=\"lazy\" src=\"https://img.shields.io/npm/v/playwright.svg\"/></a> <!-- GEN:chromium-version-badge --><a class=\"tippyAnchor reference external\" href=\"https://www.chromium.org/Home\"><img alt=\"Chromium version\" loading=\"lazy\" src=\"https://img.shields.io/badge/chromium-131.0.6778.33-blue.svg?logo=google-chrome\"/></a><!-- GEN:stop --> <!-- GEN:firefox-version-badge --><a class=\"tippyAnchor reference external\" href=\"https://www.mozilla.org/en-US/firefox/new/\"><img alt=\"Firefox version\" loading=\"lazy\" src=\"https://img.shields.io/badge/firefox-132.0-blue.svg?logo=firefoxbrowser\"/></a><!-- GEN:stop --> <!-- GEN:webkit-version-badge --><a class=\"tippyAnchor reference external\" href=\"https://webkit.org/\"><img alt=\"WebKit version\" loading=\"lazy\" src=\"https://img.shields.io/badge/webkit-18.2-blue.svg?logo=safari\"/></a><!-- GEN:stop --> <a class=\"tippyAnchor reference external\" href=\"https://aka.ms/playwright/discord\"><img alt=\"Join Discord\" loading=\"lazy\" src=\"https://img.shields.io/badge/join-discord-infomational\"/></a></p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
